import React, {useEffect} from 'react';
import axios from 'axios';
import Home from "./home";
import Header from './contents/components/Header';

function App() {
    const callApi = async () => {
        axios.get('/api').then((res) => console.log(res.data.test));
    };

    useEffect(() => {
        callApi();
    }, []);
  return (
    <div className="App">
      <Home />
      <Header />
    </div>
  );
}

export default App;
